Querying a range of dates in Mongoose and Node<p>I have the following User schema:</p>
<pre><code>const User = mongoose.model(
  &quot;User&quot;,
  new mongoose.Schema({
    email: String,
    password: String,
    name: String,
    days: [
      {
      day: Date,
      data:  
        { 
          average_score: {type: mongoose.Schema.Types.Decimal128, default: 0 }
        }
      }
    ]
  })
);
</code></pre>
<p>In the day field I'm storing the days in ISO format like 2020-12-29T00:00:00.000Z for example.
The query is returning all the data instead of returning the data for the days between the Date range.</p>
<pre><code>User.find({ &quot;_id&quot;: getUserId(req), &quot;days.day&quot;:{
        &quot;$gte&quot;: new Date(&quot;2021-01-02T00:00:00.000Z&quot;), 
        &quot;$lt&quot;: new Date(&quot;2021-01-04T00:00:00.000Z&quot;)
    }},
    function (err, result) {
      if (err){
        res.status(400).send({data: { message: err }});
        return;
      }
      else if(result)
      {
        res.status(200).send({data: { message: result }});
      }
    })
</code></pre>
<p>The solution that I found to work is:</p>
<pre><code>let itsArray = Array.isArray(req.body.day)
    let first = itsArray ?  new Date(new Date(req.body.day[0]).toISOString()) : null
    let second = itsArray ? new Date(new Date(req.body.day[1]).toISOString()) : null
    let theDay = itsArray ? null : new Date(req.body.day)
    let now = new Date()
    theDay = itsArray ? null :  new Date(new Date(theDay).toISOString())

    const objectProject = { $project: {
        days: {
          $filter: {
            input: &quot;$days&quot;,
            as: &quot;index&quot;, 
            cond:{ $eq: [ &quot;$$index.day&quot;, theDay ] },
          }
        }
    }}

    const arrayProject = { $project: {
        days: {
          $filter: {
            input: &quot;$days&quot;,
            as: &quot;index&quot;, 
            cond: {$and: [
              { $gte: [ &quot;$$index.day&quot;, first ] },
              { $lte: [ &quot;$$index.day&quot;, second ] }
            ]}
          }
        }
    }}

    await User.aggregate([
    {$match:{_id: ObjectID(getUserId(req))}},
    itsArray ? arrayProject : objectProject
  ])
  .project({'days.day':1, 'days.data':1})
  .then(result =&gt; {console.log(result})
</code></pre>
<p>Using project, match and then filter seems to yield the desired results.</p>

