Using MongoDB .findOne() function with nested document value<p>Consider I have this document in my MongoDB collection, Workout:</p>
<pre><code>{
  _id: ObjectId(&quot;60383b491e2a11272c845749&quot;) &lt;--- Workout ID
  user: ObjectId(&quot;5fc7d6b9bbd9473a24d3ab3e&quot;) &lt;--- User ID
  exercises: [
    {
      _id: ObjectId(&quot;...&quot;) &lt;--- Exercise ID
      exerciseName: &quot;Bench Press&quot;,
      sets: [
        {
          _id: ObjectId(&quot;...&quot;) &lt;--- Set ID
        },
        {
          _id: ObjectId(&quot;...&quot;) &lt;--- Set ID
        }
      ]
    }
  ]
}
</code></pre>
<p>The Workout object can include many exercise objects in the exercises array and each exercise object can have many set objects in the sets array. I am trying to implement a delete functionality for a certain set. I need to retrieve the workout that the set I want to delete is stored in. I have access to the user's ID (stored in a context), exercise ID and the set ID that I want to delete as parameters for the .findOne() function. However, I'm not sure whether I can traverse through the different levels of arrays and objects within the workout object. This is what I have tried:</p>
<pre><code>const user = checkAuth(context) // Gets logged in user details (id, username)
